import SvgIcon from '@material-ui/icons/Print';
import Skull from '../assets/icons.skull.svg';
const GetIcon :any= {
    'Skull' : Skull,
    
  }
  const Icon = ({icon, onclick, fontSize, color}: {icon?:string, onclick?:(e:any)=>void; fontSize?: number, color?: string}) => {
    const myIcon = GetIcon[icon as string];
    if (!myIcon) return <div></div>;
    return (
      <SvgIcon
        onClick={(e: any) => {
          return onclick ? onclick(e) : null;
        }}
        style={{
          fontSize: fontSize === undefined ? 30 : fontSize,
          color: color === undefined ? '' : color,
        }}
        component={myIcon}
      ></SvgIcon>
    );
  };
  
  export default Icon;
